  {
    title: 'Reunión',
    start: new Date(2024, 3, 1, 10, 0),
    end: new Date(2024, 3, 1, 12, 0),
  },
  // Agrega más eventos según sea necesario
];

function MyCalendar() {
  return (
    <div style={{ height: 500 }}>
      <Calendar
        localizer={localizer}
        events={events}
        startAccessor="start"
        endAccessor="end"
        style={{ margin: '50px' }}
      />
    </div>
  );
}

export default MyCalendar;
